import React, {
  useEffect,
  useState,
  useContext
} from 'react'
import './App.css';
import { AiOwlContext } from './ContextAiOwl'
import aiowl from './media/aiowl.gif'
import Loading from './loading'
import FadeIn from 'react-fade-in'
import styled from 'styled-components'
import Particles from 'react-particles-js';


export const eel = window.eel
eel.set_host( 'ws://localhost:8080' )

function App() {
  const [loading, setLoading] = useContext(AiOwlContext)
  let [command, setCommand] = useState('')
  let [title, setTitle] = useState('')
  let [thumbnail, setThumbnail] = useState('')
  let [result, setResult] = useState('')
  let [gogoduck, setGogoduck] = useState({})
  let [musicOn, setMusicOn] = useState(false)

  const updateC = (data) => {
    setCommand(data)
  }
  window.eel.expose(updateC, 'updateC')

  const updateTnB = (title, body, tmb) => {
    setTitle(title)
    setResult(body)
    if (tmb) {
      setMusicOn(true)
      } else {
      setMusicOn(false)
      }
  }
  window.eel.expose(updateTnB, 'updateTnB')

  const updateP = (data) => {
    setThumbnail(`http://img.youtube.com/vi/${data}/mqdefault.jpg`)
  }
  window.eel.expose(updateP, 'updateP')

  const gogoDuck = (data) => {
    setGogoduck(data)
    console.log(gogoduck);
  }
  window.eel.expose(gogoDuck, 'gogoDuck')

  const pari = {
    "particles": {
        "number": {
            "value": 160,
            "density": {
                "enable": false
            }
        },
        "size": {
            "value": 3,
            "random": true,
            "anim": {
                "speed": 4,
                "size_min": 0.3
            }
        },
        "line_linked": {
            "enable": false
        },
        "move": {
            "random": true,
            "speed": 1,
            "direction": "top",
            "out_mode": "out"
        }
    },
    "interactivity": {
        "events": {
            "onhover": {
                "enable": true,
                "mode": "bubble"
            },
            "onclick": {
                "enable": true,
                "mode": "repulse"
            }
        },
        "modes": {
            "bubble": {
                "distance": 250,
                "duration": 2,
                "size": 0,
                "opacity": 0
            },
            "repulse": {
                "distance": 400,
                "duration": 4
            }
        }
    }
}

  // useEffect(() => {
  //   setInterval(() => { 
  //   setLoading(false)
  //   eel.fricc()
  // }, 2000);

  // }, [])

  return (loading ? <Loading /> :
    <FadeIn>
      <Particles
    params={pari} />
      <Div id="otosan" className="papi">
        <div id="dots" />
        <div className='topdiv'>
          <img src={aiowl} alt="" />
        </div>
        <div className="middiv">
          <h2 id="command">{command}</h2>
          <h1 id="resultTitle">{title}</h1>
          {musicOn ? 
          <div className="dd">
            <img id="resultimg" src={thumbnail} alt="" />
          </div> : <div />}
          <p id="resultBody">{result}</p>
          <p id="resultsrc">Source</p>
        </div>
      </Div>
    </FadeIn>
  );
}

export default App;

const Div = styled.div`
`
